text:
박은태 배우님을 비롯해 이규형, 임혜영, 김아선, 김현진 배우님.. 너무 좋은 공연 감사했습니다.
특히 장예원, 윤나리,윤지인, 윤정열, 박세훈, 지원선 배우님.. 배우님들덕분에 완성도 높은 공연을 볼 수 있어서 행복했습니다. 힘든 시국에도 묵묵히 자리를 지켜주셔서 감사했습니다&#129505;
다른 공연에서도 또 만나뵙기를 바랄게요!

뮤지컬 [젠틀맨스 가이드]를 만나고 왔다. 찢어지는 가난 속에서 자라난 청년 몬티가 사실은 어마어마한 재벌가 ''다이스퀴스 가문''의 9번째 상속자라는 사실을 안 후, 자신의 앞에 있는 8명을 살인해나가는 과정을 유쾌하고 재미있는 코미디로 풀어낸 작품.

&#8203;

주인공은 몬티이긴 하지만, 몬티의 살인 대상인 모든 다이스퀴스들을 연기하는 ''다이스퀴스'' 역할이 정말 중요한 공연이다. 이걸 어떻게 살리냐에 따라 웃음 포인트의 강도도 달라질 듯ㅎ

&#8203;

이상이 배우님은 1막에서는 브로콜리 버금가는 더벙머리를 하고 나타나 모든 인물들에게 ''브로콜리''라고 놀림을 당해서 너무 웃겼고ㅋㅋ 특히, 다이스퀴스 은행장의 밑에서 일하게 되어 새로운 수트비를 줄 때 이규형 배우님의 애드립으로 ''미용실도 꼭 다녀오라''고 하여 더욱 웃음이 터졌다 (실제로 2막에서 머리스타일을 변경하고 나타나 뿌듯해하며 은행장님에게 달려가던 모습ㅋ)

&#8203;

이상이 배우님과 이규형 배우님의 합이 워낙 좋고 애드립이 폭발해서 내내 많이 웃었던 공연! (가끔은 현웃이 너무 많이 터져서 좀 자제했으면 싶어질 때도 있었지만 대체로는 만족스럽게 관람했다!)

&#8203;

[젠틀맨스 가이드]는 특히 이렇게 심각한 시국에 잠시나마 웃음으로 털어낼 수 있는 참 좋은 작품이라는 생각이 든다. 이상이-이규형 배우님 조합 나올 때까지 얼마나 기다렸는데ㅠㅠ 드디어 무대에서 만날 수 있어 벅차구나ㅠㅠ

배우님들 다 연기, 노래 두말할 것 없이 완벽합니다.
이규형배우님 능청스러운 연기에 이상이배우님 당황하는 거 보는 재미가 쏠쏠했어요!
또 보고 싶어요&#128077;&#128077;
